import axios from 'axios';
import React, {useState, useEffect} from 'react'
import Info from '../../context/Info'
import * as Apis from '../../context/Api' 
import { Paper, Table, TableCell, TableContainer, TableRow } from '@mui/material';
export default function Deldes() {


const [des, setdes] = useState([])

useEffect(() => {
    getData()
}, [])


const getData =()=>{
    let data= {
        createdById: Info.userInfo._id,
        isDeleted: "true"

    };

    axios.post(Apis.deslist(),data).then((response)=>{
        setdes(response.data.data)
        console.log(response.data.data);
    })
}

    return (
        < >
            <div className="container">
                <TableContainer component={Paper}>
                    <Table aria-label='simpletable'>
                        <TableRow>
                            <TableCell>
                                S.no
                            </TableCell>
                            <TableCell>
                                Department
                            </TableCell>
                            <TableCell>
                                Designation
                            </TableCell>
                            <TableCell>
                                Action
                            </TableCell>
                        </TableRow>
                    </Table>
                </TableContainer>
            </div>
        </>
    )
}
